import * as React from "react";
import ContentLayout from "@cloudscape-design/components/content-layout";
import Container from "@cloudscape-design/components/container";
import Header from "@cloudscape-design/components/header";
import SpaceBetween from "@cloudscape-design/components/space-between";
import Link from "@cloudscape-design/components/link";
import Button from "@cloudscape-design/components/button";
import Alert from "@cloudscape-design/components/alert";
import FileUpload from "@cloudscape-design/components/file-upload";
import FormField from "@cloudscape-design/components/form-field";
import AttributeEditor from "@cloudscape-design/components/attribute-editor";
import Input from "@cloudscape-design/components/input";
import Tabs from "@cloudscape-design/components/tabs";
import AttributeEditorExample from "./ChangableAttributeEditor";
import TextContent from "@cloudscape-design/components/text-content";

export default function SearchPhotos() {
    const [query, setQuery] = React.useState("");

    const [items, setItems] = React.useState([
        {
          id: "1",
          rowSpan: 1,
          columnSpan: 2,
          data: { title: "Demo 1", content: "First item" }
        },
        {
          id: "2",
          rowSpan: 1,
          columnSpan: 2,
          data: { title: "Demo 2", content: "Second item" }
        },
        {
          id: "3",
          rowSpan: 1,
          columnSpan: 3,
          data: { title: "Demo 3", content: "Third item" }
        }
    ]);

    return (
        <SpaceBetween size='m'>
            <TextContent>
                <p>
                    <strong>Please enter your search query, or use the button below to transcribe from voice</strong>
                </p>
            </TextContent>
            <Input
                onChange={({ detail }) => setQuery(detail.value)}
                value={query}
                placeholder="Please enter your search query"
                type="search"
            />
            <Button>Transcribe your voice</Button>
            <Button variant="primary">Submit Search Query</Button>
            <TextContent>
                <p>
                    <strong>Search Results are displayed below</strong>
                </p>
            </TextContent>
            <Board
                renderItem={item => (
                    <BoardItem
                    header={<Header>{item.data.title}</Header>}
                    i18nStrings={{
                        dragHandleAriaLabel: "Drag handle",
                        dragHandleAriaDescription:
                        "Use Space or Enter to activate drag, arrow keys to move, Space or Enter to submit, or Escape to discard.",
                        resizeHandleAriaLabel: "Resize handle",
                        resizeHandleAriaDescription:
                        "Use Space or Enter to activate resize, arrow keys to move, Space or Enter to submit, or Escape to discard."
                    }}
                    >
                    {item.data.content}
                    </BoardItem>
                )}
                onItemsChange={event =>
                    setItems(event.detail.items)
                }
                items={items}
                i18nStrings={(() => {
                    function createAnnouncement(
                    operationAnnouncement,
                    conflicts,
                    disturbed
                    ) {
                    const conflictsAnnouncement =
                        conflicts.length > 0
                        ? `Conflicts with ${conflicts
                            .map(c => c.data.title)
                            .join(", ")}.`
                        : "";
                    const disturbedAnnouncement =
                        disturbed.length > 0
                        ? `Disturbed ${disturbed.length} items.`
                        : "";
                    return [
                        operationAnnouncement,
                        conflictsAnnouncement,
                        disturbedAnnouncement
                    ]
                        .filter(Boolean)
                        .join(" ");
                    }
                    return {
                    liveAnnouncementDndStarted: operationType =>
                        operationType === "resize"
                        ? "Resizing"
                        : "Dragging",
                    liveAnnouncementDndItemReordered: operation => {
                        const columns = `column ${operation.placement
                        .x + 1}`;
                        const rows = `row ${operation.placement.y +
                        1}`;
                        return createAnnouncement(
                        `Item moved to ${
                            operation.direction === "horizontal"
                            ? columns
                            : rows
                        }.`,
                        operation.conflicts,
                        operation.disturbed
                        );
                    },
                    liveAnnouncementDndItemResized: operation => {
                        const columnsConstraint = operation.isMinimalColumnsReached
                        ? " (minimal)"
                        : "";
                        const rowsConstraint = operation.isMinimalRowsReached
                        ? " (minimal)"
                        : "";
                        const sizeAnnouncement =
                        operation.direction === "horizontal"
                            ? `columns ${operation.placement.width}${columnsConstraint}`
                            : `rows ${operation.placement.height}${rowsConstraint}`;
                        return createAnnouncement(
                        `Item resized to ${sizeAnnouncement}.`,
                        operation.conflicts,
                        operation.disturbed
                        );
                    },
                    liveAnnouncementDndItemInserted: operation => {
                        const columns = `column ${operation.placement
                        .x + 1}`;
                        const rows = `row ${operation.placement.y +
                        1}`;
                        return createAnnouncement(
                        `Item inserted to ${columns}, ${rows}.`,
                        operation.conflicts,
                        operation.disturbed
                        );
                    },
                    liveAnnouncementDndCommitted: operationType =>
                        `${operationType} committed`,
                    liveAnnouncementDndDiscarded: operationType =>
                        `${operationType} discarded`,
                    liveAnnouncementItemRemoved: op =>
                        createAnnouncement(
                        `Removed item ${op.item.data.title}.`,
                        [],
                        op.disturbed
                        ),
                    navigationAriaLabel: "Board navigation",
                    navigationAriaDescription:
                        "Click on non-empty item to move focus over",
                    navigationItemAriaLabel: item =>
                        item ? item.data.title : "Empty"
                    };
                })()}
            />
        </SpaceBetween>
    );
}
